import {Link} from 'react-router-dom'
import Room from './Room'

export default function Rooms(props) {

    /* <Room 
        name={r.name}
        color={r.color}
        type={r.type}
        products={r.products}
    /> */

    return (
        <div>
            {props.rooms.map(r=>{
                    return (
                        <div 
                            className='room'
                            style={{backgroundColor: r.color}}
                            onClick={()=>{}}><h1>{r.name}</h1>
                        </div>
                    )
                })}
            <Link to='/addroom'><button>+</button></Link>
        </div>
    )
}
